  'AdminCatalogHelp' => 
  array (
    'Use POP3 instead of IMAP.' => 'Gamitin ang POP3 sa halip na IMAP.',
    'Create a new product: CTRL+P' => 'Gumawa ng isang bagong produkto: CTRL+P',
    'Enter your product name' => 'Ilagay ang pangalan ng iyong produkto',
    'The summary is a short sentence describing your product.<br />It will appears at the top of your shop\'s product page, in product lists, and in search engines\' results page (so it\'s important for SEO). To give more details about your product, use the "Description" tab.' => 'Ang buod ay isang maikling pangungusap na naglalarawan sa iyong produkto.<br />ito ay lalabas sa itaas ng pahina ng produkto ng iyong tindahan, sa mga listahan ng produkto, at sa pahina ng mga resulta ng paghahanap ng makina (kaya ito ay napakahalaga para sa SEO). Para magbigay ng maraming mga detalye tungkol sa iyong produkto, gamitin ang tab ng "paglalarawan.".',
    'Search and add a related product' => 'Hanapin at idagdag ang isang kaugnay na produkto',
    'Use a comma to create separate tags. E.g.: dress, cotton, party dresses.' => 'Gumamit ng isang kuwit para gawin ang magkahiwalay ng mga tag. Hal.: damit, bulak, mga damit pangkasiyahan.',
    'Per kilo, per litre' => 'Kada kilo, kada litro',
    'Combine several attributes, e.g.: "Size: all", "Color: red".' => 'Pagsamahin ang ilang mga katangian, hal.: "Sukat: lahat". "Kulay: pula".',
    'To which product the page should redirect?' => 'Kung saang produkto ang pahina ay dapat muling idirekta?',
    'To which category the page should redirect?' => 'Saang kategorya ang pahina ay dapat na muling idirekta?',
    'To have a different title from the product name, enter it here.' => 'Para magkaroon ng ibang titulo sa pangalan ng produkto, ipasok ito dito.',
    'To have a different description than your product summary in search results pages, write it here.' => 'Para magkaroon ng isang magkaibang paglalarawan kaysa sa iyong buod ng produkto sa mga pahina ng paghahanap ng mga resulta, Isulat ito dito.',
    'This description will appear in search engines. You need a single sentence, shorter than 160 characters (including spaces)' => 'Ang paglalarawan na ito ay lalabas sa mga makinang panghanap. Kailangan mo ng isang solong pangungusap, maiksi kaysa sa mga 160 na karakter (kasama ang mga espasyo)',
    'Public title for the product\'s page, and for search engines. Leave blank to use the product name. The number of remaining characters is displayed to the left of the field.' => 'Ang pampublikong titulo para sa pahina ng produkto, at para sa makinang panghanap. Iwanang blanko para magamit ang pangalan ng produkto. Ang bilang ng natitirang mga karakter ay naka-displey sa kaliwa ng field.',
    'Upload a brand logo from your computer.' => 'Mag-upload ng tatak ng logo mula sa iyong kumpyuter.',
    'Search name' => 'Hanapin ang pangalan',
    'Search category' => 'Ang paghahanap sa kategorya',
    'Search ref.' => 'Ang ref ng paghahanap.',
    'Save the product and stay on the current page: ALT+SHIFT+S' => 'I-seyb ang produkto at manatili sa iyong kasalukuyang pahina: ALT+SHIFT+S',
    'Permanently delete this product.' => 'Ang permanenteng pagbura sa produktong ito.',
    'See how your product sheet will look online: ALT+SHIFT+V' => 'Tingnan kung papaanong ang sheet ng iyong produkto ay makikita online: ALT+SHIFT+V',
    'Enable or disable the product on your shop: ALT+SHIFT+O' => 'Paganahin o hindi paganahin ang produkto sa iyong tindahan: ALT+SHIFT+O',
    'Save and duplicate this product, then go to the new product: ALT+SHIFT+D' => 'I-seyb o duplikahin ang produktong ito, ngayon pumunta sa panibagong produkto: ALT+SHIFT+D',
    'Save and go back to the catalog: ALT+SHIFT+Q' => 'I-seyb at bumalik sa katalogo: ALT+SHIFT+Q',
    'Save and create a new product: ALT+SHIFT+P' => 'I-seyb at gumawa ng isang panibagong produkto: ALT+SHIFT+P',
    'Is the product a pack (a combination of at least two existing products), a virtual product (downloadable file, service, etc.), or simply a standard, physical product?' => 'Ang produkto ba ay nasa isang pakete (isang kumbinasyon ng kahit dalawa pa sa mga produktong ito), ang isang birtwal na produkto (kopyahin ang payl, serbisyo, atbp.), o isang pamantayan lamang. ng pisikal na produkto?',
    'Where should the product be available on your site? The main category is where the product appears by default: this is the category which is seen in the product page\'s URL. Disabled categories are written in italics.' => 'Saan dapat ang iyong produkto ay makukuha sa iyong sayt? Ang pangunahing kategorya ay kung saan ang produkto ay lalabas sa pamamagitan ng default: ito ang kategorya kung saan ay makikita sa URL ng pahina ng produkto. Ang hindi pinaganang mga kategorya ay nakasulat sa mga italic.',
    'If you want to quickly create a new category, you can do it here. Don’t forget to then go to the Categories page to fill in the needed details (description, image, etc.).  A new category will not automatically appear in your shop\'s menu, please read the Help about it.' => 'Kung nais mo na mabilis makalikha ng isang bagong kategorya, maari mo itong magawa rito. Huwag kalimutan na magpunta sa mga pahina ng mga kategorya para malagyan ang kailangan na mga detalye (paglalarawan, imahe, atbp.). Ang bagong kategorya ay hindi awtomatikong lalabas sa iyong menu ng tindahan. pakiusap basahin ang Tulong pa tungkol dito.',
    'Search categories' => 'Ang paghahanap ng mga kategorya',
    'Does this combination have a different price? Is it cheaper or more expensive than the default retail price?' => 'Ang kombinasyon ba na ito ay mayroong magkakaibang presyo? Ito ba ay mas mura o mas mahal kesa sa default na tinging halaga?',
    'The minimum quantity required to buy this product (set to 1 to disable this feature). E.g.: if set to 3, customers will be able to purchase the product only if they take at least 3 in quantity.' => 'Ang pinakamababang kantidad na kailangan para mabili ang produkto na ito (itakda sa 1 para hindi gumana ang tampok na ito). Hal.: kung itakda sa 3, ang mga kustomer ay maaari lamang bumili ng produkto kung sila ay kukuha ng hindi bababa sa 3 sa kantidad.',
    'Combinations are the different variations of a product, with attributes like its size, weight or color taking different values. To create a combination, you need to create your product attributes first. Go to Catalog > Attributes & Features for this!' => 'Ang mga kumbinasyon ay ang iba-ibang mga pagkakaiba ng isang produkto, na may mga katangiang tulad ng sukat, bigat o kulay na may magkakaibang mga halaga. Para gawin ang isang kombinasyon. kailangan mo munang gumawa ng mga katangian ng iyong produkto. Pumunta sa Katalogo > Mga katangian at mga Tampok para dito!',
    'When your product is disabled, choose to which page you’d like to redirect the customers visiting its page by typing the product or category name.' => 'Kapag hindi gumagana ang iyong produkto, pumili kung aling pahina ang gusto mong muling i-direkta ang mga kostumer na bibisita sa pahina na ito sa pamamagitan ng pag-susulat ng pangalan ng produkto o kategorya.',
    'No redirection (404) = Do not redirect anywhere and display a 404 "Not Found" page.' => 'Walang muling pagdirekta (404) = Huwag muling magdirekta kahit saan at i-displey ang pahina ng isang 404 "Hindi makita".',
    'Permanent redirection (301) = Permanently display another product or category instead.' => 'Ang permanenteng muling pagdirekta (301) =Ang permanenteng pagpapakita sa iba pang produkto o sa halip ay kategorya.',
    'Temporary redirection (302) = Temporarily display another product or category instead.' => 'Ang panandaliang muling pagdirekta (302) = Panandaliang idispley ang iba pang produkto o sa halip ay kategorya.',
    'This interface allows you to specify the suppliers of the current product and its combinations, if any.' => 'Ang interface na ito ay pahihintulutan ka na matukoy ang mga tagapagtustos ng kasalukuyang produkto at ang mga kombinasyon nito, kung mayroon man.',
    'You can specify supplier references according to previously associated suppliers.' => 'Maaari mong tukuyin ang mga sanggunian ng tagapagtustos ayon sa nakaraang mga nauugnay na tagapagtustos.',
    'When using the advanced stock management tool (see Shop Parameters > Products settings), the values you define (price, references) will be used in supply orders.' => 'Kapag ginagamit ang tool ng pamamahala ng pangunahing panustos (tingnan ang parametro ng tindahan > mga pagtatakda ng produkto), ang mga halaga na tinukoy mo (presyo, mga sanggunian) ay maaaring gamitin sa mga order ng panustos.',
    'It is also possible to specify the location within the warehouse for each product or combination.' => 'Ito rin ay posibleng matukoy ang lokasyon sa loob ng bodega para sa bawat produkto o kumbinasyon.',
    'Upload a file from your computer (%maxUploadSize% max.)' => 'I-upload ang isang payl mula sa iyong kompyuter (%maxUploadSize% max.)',
    'Combinations are the different variations of a product, with attributes like its size, weight or color taking different values. Does your product require combinations?' => 'Ang mga kombinasyon ay ang iba\'t ibang mga pagkakaiba ng isang produkto, na may mga katangian gaya ng kanilang sukat, bigat o kulay na may iba-ibang mga halaga. Ang iyo bang produkto ay na ngangailangan ng mga kombinasyon?',
    'Advanced settings in [1][2]Combinations[/1]' => 'Ang pangunahing mga pagtatakda sa [1][2]mga Kombinasyon[/1]',
    'Your reference code for this product. Allowed special characters: .-_#.' => 'Ang iyong sangguniang kowd para sa produktong ito. Pinapahintulutan ang espesyal na karakter na: .-_#.',
    'How many products should be available for sale?' => 'Ilang mga produkto ang dapat na magagamit para sa pagbenta?',
    'Advanced settings in [1][2]Quantities[/1]' => 'Ang pangunahing mga pagtatakda sa [1][2]Kantidad[/1]',
    'This is the retail price at which you intend to sell this product to your customers. The tax included price will change according to the tax rule you select.' => 'Ito ang halaga ng tingi kung saan maaari mong ibenta ang produktong ito sa iyong mga kustomer. Ang buwis na kasama ang halaga ay mababago ayon sa patakaran ng buwis na iyong napili.',
    'Advanced settings in [1][2]Pricing[/1]' => 'Ang pangunahing pagtatakda sa [1][2]Pagpepresyo[/1]',
    'ISBN is used internationally to identify books and their various editions.' => 'Ang ISBN ay ginagamit sa pangdaigdigan para makilala ang mga libro at ang kanilang mga iba\'t-ibang mga edisyon.',
    'Tags are meant to help your customers find your products via the search bar.' => 'Ang mga tag ay sinadya upang matulungan ang iyong mga kustomer na mahanap ang iyong mga produkto sa pamamagitan ng bar na panghanap.',
    'Choose terms and keywords that your customers will use to search for this product and make sure you are consistent with the tags you may have already used.' => 'Pumili ng mga paliwanag at mga keyword na magagamit ng iyong mga kustomer upang maghanap para sa produktong ito at tiyaking nakaayon ka sa mga tag na ginamit mo na.',
    'You can manage tag aliases in the [1]Search section[/1]. If you add new tags, you have to rebuild the index.' => 'Maaari mong pamahalaan ang mga alias ng tag sa [1] seksyon ng Paghahanap [/1]. Kung magdagdag ka ng mga bagong tag, kailangan mong itayong muli ang talatuntunan.',
    'Not all shops sell new products. This option enables you to indicate the condition of the product. It can be required on some marketplaces.' => 'Hindi lahat ng tindahan ay nagbebenta ng mga bagong produkto. Ang pagpipiliang ito ay nagbibigay-daan sa iyo upang ipabatid ang kalagayan ng produkto. Ito ay maaaring kinakailangan sa ilang mga lugar ng merkado.',
    'This is the price at which you intend to sell this product to your customers. The tax included price will change according to the tax rule you select.' => 'Ito ang presyo kung saan gusto mong ibenta ang produktong ito sa iyong mga kustomer. Ang presyo na kasama ang buwis ay maaaring mabago ayon sa patakaran ng buwis na iyong pinili.',
    'The cost price is the price you paid for the product. Do not include the tax. It should be lower than the retail price: the difference between the two will be your margin.' => 'Ang presyo ng nagastos ay ang presyo na iyong binayaran para sa produkto. Huwag isama ang kaukulang buwis. Ito ay dapat na mas mababa kaysa sa tingiang presyo: ang pagkakaiba sa pagitan ng dalawa ay ang iyong magiging margin.',
    'You can set specific prices for customers belonging to different groups, different countries, etc.' => 'Maaari kang magtakda ng mga siguradong presyo para sa mga kustomer na kabilang sa iba\'t ibang mga grupo, iba\'t ibang mga bansa, atbp.',
    'Sometimes one customer can fit into multiple price rules. Priorities allow you to define which rules apply first.' => 'Minsan ang isang kustomer ay maaaring magkasya sa maraming mga panuntunan sa presyo. Pinapayagan ka ng mga prayoridad na alamin kung aling mga tuntunin ang unang i-aaplay.',
    '[1]Invalid token[/1]: direct access to this link may lead to a potential security breach.' => '[1]hindi balido na token[/1]: Direkta na pag- access sa link na ito ay magtuturo sa potensyal na paglabag sa seguridad.',
    'Do you want to display this page?' => 'Nais mo ba na idispley ang pahina na ito?',
    'Yes, I understand the risks' => 'Oo, nauunawaan ko ang mga panganib',
    'Take me out of there!' => 'Kunin mo ako paalis doon!',
    'Displays a small image in the parent category\'s page, if the theme allows it.' => 'Ipakita ang isang maliit na imahe sa pahina ng kategorya ng pinagmulan, kung ang tema ay pinahihintulutan ito.',
    'The category thumbnail appears in the menu as a small image representing the category, if the theme allows it.' => 'Ang kategorya ng thumbnail ay lalabas sa menu bilang maliit na imahe na kumakatawan sa kategorya, kung ang tema ay pinahihintulutan ito.',
  ),
