    'When the Faceted Search module is enabled, you can get more detailed URLs by choosing the word that best represent this attribute. By default, PrestaShop uses the attribute\'s name, but you can change that setting using this field.' => 'Kapag ang Faceted Search na modulo ay gumagana, maaari kang makakuha ng mga URL na detalyado sa pamamagitan ng pagpili ng salita na pinakamahusay na kumakatawan sa katangian nito. Sa default, ginagamit ng PrestaShop ang pangalan ng katangian, ngunit maaari mong baguhin ang pagtatakda gamit ang patlang na ito.',
