    'When the Faceted Search module is enabled, you can get more detailed URLs by choosing the word that best represent this feature\'s value. By default, PrestaShop uses the value\'s name, but you can change that setting using this field.' => 'Kapag ang Faceted Search na modulo ay pinapagana, maaari kang makakuha ng detalyadong mga URL sa pamamagitan ng pagpili ng salitang pinakamahusay na kumakatawan sa kahalagahan ng itinatampok na ito. Sa pamamagitan ng default, ginagamit ng PrestaShop ang pinapahalagahan na pangalan, ngunit maaari mong baguhin ang pagtatakda gamit ang patlang na ito.',
